INSERT INTO "MOON"."DETAIL" VALUES ('hive', 'hive是基于Hadoop的一个 数据仓库工具，可以将结构化的数据文件映射为一张数据库表，并提供简单的sql查询功能，可以将sql语句转换为MapReduce任务进行运行。 其优点是学习成本低，可以通过类SQL语句快速实现简单的MapReduce统计，不必开发专门的MapReduce应用，十分适合 数据仓库的统计分析。 Hive是建立在 Hadoop 上的数据仓库基础构架。它提供了一系列的工具，可以用来进行数据提取转化加载（ETL），这是一种可以存储、查询和分析存储在 Hadoop 中的大规模数据的机制。Hive 定义了简单的类 SQL 查询语言，称为 HQL，它允许熟悉 SQL 的用户查询数据。同时，这个语言也允许熟悉 MapReduce 开发者的开发自定义的 mapper 和 reducer 来处理内建的 mapper 和 reducer 无法完成的复杂的分析工作。 Hive 没有专门的数据格式。 Hive 可以很好的工作在 Thrift 之上，控制分隔符，也允许用户指定数据格式。');
INSERT INTO "MOON"."DETAIL" VALUES ('前端', '前端即 网站前台部分，运行在 PC端， 移动端等 浏览器上展现给用户浏览的网页。随着 互联网技术的发展， HTML5， CSS3，前端框架的应用， 跨平台 响应式网页设计能够适应各种屏幕分辨率，完美的动效设计，给用户带来极高的 用户体验。 [1] ？');
INSERT INTO "MOON"."DETAIL" VALUES ('移动开发', '移动开发也称为 手机开发，或叫做移动互联网开发。是指以手机、PDA、UMPC等便携终端为基础，进行相应的开发工作，由于这些随身设备基本都采用无线上网的方式，因此，业内也称作为无线开发。');
INSERT INTO "MOON"."DETAIL" VALUES ('java', 'Java是一门 面向对象编程语言，不仅吸收了 C++语言的各种优点，还摒弃了C++里难以理解的 多继承、 指针等概念，因此Java语言具有功能强大和简单易用两个特征。Java语言作为静态面向对象编程语言的代表，极好地实现了面向对象理论，允许程序员以优雅的思维方式进行复杂的编程 [1] ? 。 Java具有简单性、面向对象、 分布式、 健壮性、 安全性、平台独立与可移植性、 多线程、动态性等特点 [2] ? 。Java可以编写 桌面应用程序、 Web应用程序、 分布式系统和 嵌入式系统应用程序等 [3] ? 。');
INSERT INTO "MOON"."DETAIL" VALUES ('并发', '并发，在 操作系统中，是指一个时间段中有几个程序都处于已启动运行到运行完毕之间，且这几个程序都是在同一个 处理机上运行，但任一个时刻点上只有一个程序在处理机上运行。');
INSERT INTO "MOON"."DETAIL" VALUES ('学习', '学习，是指通过 阅读、 听讲、 思考、 研究、实践等途径获得 知识或 技能的 过程。学习分为狭义与广义两种： 狭义：通过 阅读、听讲、 研究、 观察、 理解、 探索、 实验、实践等手段获得知识或技能的过程，是一种使个体可以得到持续变化（知识和技能，方法与过程，情感与价值的改善和升华）的行为方式。例如通过学校教育获得知识的过程。 广义：是人在生活过程中，通过获得经验而产生的行为或行为潜能的相对持久的行为方式。');
INSERT INTO "MOON"."DETAIL" VALUES ('计算', '计算，汉语词语，有“核算 数目，根据已知量算出未知量；运算”和“考虑；谋虑”两种含义。');
INSERT INTO "MOON"."DETAIL" VALUES ('android', 'Android是一种基于 Linux的自由及开放源代码的 操作系统，主要使用于 移动设备，如 智能手机和 平板电脑，由 Google公司和 开放手机联盟领导及开发。尚未有统一中文名称，中国大陆地区较多人使用“ 安卓”或“ 安致”。Android操作系统最初由 Andy Rubin开发，主要支持 手机。2005年8月由Google收购注资。2007年11月，Google与84家硬件制造商、软件开发商及电信营运商组建开放手机联盟共同研发改良Android系统。随后Google以Apache开源许可证的授权方式，发布了Android的源代码。第一部Android智能手机发布于2008年10月。Android逐渐扩展到 平板电脑及其他领域上，如 电视、 数码相机、 游戏机、 智能手表等。2011年第一季度，Android在全球的市场份额首次超过 塞班系统，跃居全球第一。 2013年的第四季度，Android平台手机的全球市场份额已经达到78.1%。 [1] ? 2013年09月24日谷歌开发的操作系统Android在迎来了5岁生日，全世界采用这款系统的设备数量已经达到10亿台。 2014第一季度Android平台已占所有移动广告流量来源的42.8%，首度 超越iOS。但运营收入不及iOS。 [2] ?');
INSERT INTO "MOON"."DETAIL" VALUES ('编程', '编程是编写程序的中文简称，就是让计算机代为解决某个问题，对某个计算体系规定一定的运算方式，使计算体系按照该计算方式运行，并最终得到相应结果的过程。 为了使计算机能够理解人的 意图，人类就必须将需解决的问题的思路、方法和手段通过计算机能够理解的形式告诉计算机，使得计算机能够根据人的 指令一步一步去工作，完成某种特定的任务。这种人和计算体系之间交流的过程就是编程。 编程：设计具备逻辑流动作用的一种“可控体系”【注：编程不一定是针对计算机程序而言的，针对具备逻辑计算力的体系，都可以算编程。】');
INSERT INTO "MOON"."DETAIL" VALUES ('net', '.NET是微软下一代的操作平台，它允许人们在其上构建各种应用方式，使人们尽可能通过简单的方式，多样化地、最大限度地从网站获取信息，解决网站之间的协同工作，并打破计算机、设备、网站、各大机构和工业界间的障碍－－即所谓的“数字孤岛”，从而实现因特网的全部潜能，搭建起 第三代互联网平台。后缀为net是 网络服务公司，为个人或商业提供服务。');
INSERT INTO "MOON"."DETAIL" VALUES ('微', '微是一个 汉字，读作wēi，本意是指隐秘地行走，还有细小、衰落、精妙、 隐匿等 意思。该文字在《 说文》和《左传·襄公十九年》等文献均有记载。');
INSERT INTO "MOON"."DETAIL" VALUES ('信', '信（Shin），本名苏见信，1971年5月14日出生于台湾省，中国台湾男歌手、演员，毕业于华冈艺校。 2002年，加入摇滚乐团“ 信乐团”并担任主唱；同年，随信乐团推出首张音乐专辑《信乐团同名专辑》，从而正式出道 [1] ? 。2004年，出演个人首部电视剧《 死了都要爱》。2005年，推出首张个人翻唱专辑《 Special Thanks To… 感谢自选辑》 [2-3] ? 。2007年，选择单飞，并退出信乐团 [4] ? ；同年，推出第2张个人音乐专辑《 我就是我》 [5] ? ，他凭借该专辑入围第19届台湾金曲奖最佳男歌手奖 [6] ? 。2008年，推出第3张个人音乐专辑《 集乐星球》 [7] ? 。2009年，推出第4张个人专辑《 趁我》，他凭借该专辑获得Music Radio中国Top排行年度最佳男歌手奖 [8] ? 。2011年，主演个人首部电影《 赛车传奇》 [9] ? 。2013年，其主演的爱情喜剧电影《 爱情不NG》上映 [10] ? 。2016年，作为首发阵容参加湖南卫视歌唱真人秀节目《 我是歌手第四季》，最终在第6期踢馆赛中被淘汰 [11] ? ；同年，推出第8张个人音乐专辑《 大爷门》 [12] ? 。2018年，推出个人单曲《 一眼一生》 [13] ? 。');
INSERT INTO "MOON"."DETAIL" VALUES ('模式', '模式是主体行为的一般方式，包括科学实验模式、经济发展模式、企业盈利模式等，是理论和实践之间的中介环节，具有一般性、简单性、重复性、结构性、稳定性、可操作性的特征。模式在实际运用中必须结合具体情况，实现一般性和特殊性的衔接并根据实际情况的变化随时调整要素与结构才有可操作性。 [1-3] ? 模式，指 事物的标准样式。如：发展模式。');
INSERT INTO "MOON"."DETAIL" VALUES ('分析', '分析（英语：Analysis）是将 复杂的话题或事物逐渐拆分的过程，以此来达到对话题更好的理解。尽管“分析”作为一个正式的概念在近年来才逐步建立起来，这一技巧自 亚里士多德（公元前384年至322年）就已经应用在了 数学、 逻辑学等多个领域。 分析可以指： 金融分析； 系统分析； 分析化学； 分析力学； 结构分析（土木工程）； 模流分析（塑胶）； 频率分析（密码学）； 时间序列分析（统计学）； 数学分析（数学）； 实分析； 复分析； 调和分析； 泛函分析维数分析；语意分析（语言学）； 语音分析（语言学）； 哲学分析。');
INSERT INTO "MOON"."DETAIL" VALUES ('锁', '锁是一个汉字，读作suǒ，本意是指置于可启闭的器物上，以 钥匙或暗码开启，引申义是用锁锁住、封闭。该文字在《 大铁椎传》和《论衡·订鬼篇》等文献均有记载。');
INSERT INTO "MOON"."DETAIL" VALUES ('系列', '系列是汉语词语，拼音xìliè，是指相互关联的成组成套的 事物或现象。出自柯岩《 船长》：“我们可以采取改变航向、变更航速、减轻正面迎风及开慢车等一系列技术措施嘛！” 陈原《社会语言学·语言作为一种社会现象》：“语言属于社会现象的系列时，意味着什么呢？”。');
INSERT INTO "MOON"."DETAIL" VALUES ('排序', '排序是计算机内经常进行的一种操作，其目的是将一组“无序”的记录序列调整为“有序”的记录序列。分 内部排序和 外部排序，若整个排序过程不需要访问外存便能完成，则称此类排序问题为内部排序。反之，若参加排序的记录数量很大，整个序列的排序过程不可能在 内存中完成，则称此类排序问题为外部排序。内部排序的过程是一个逐步扩大记录的有序序列长度的过程。 [1] ?');
INSERT INTO "MOON"."DETAIL" VALUES ('云', '云南，简称 云（ 滇），省会 昆明，位于中国 西南的 边陲， 北回归线横贯云南省南部，属低纬度内陆地区，为 长江经济带重要组成部分，东部与 贵州， 广西为邻，北部与 四川相连，西北部紧依 西藏，西部与 缅甸接壤，南部和 老挝、 越南毗邻，云南有25个边境县分别与 缅甸、 老挝和 越南交界，国境线长4060千米，是中国通往东 南亚、 南亚的窗口和门户。 [1-2] ? 云南是人类文明重要发祥地之一，生活在距今170万年前的 元谋人，是发现的中国和亚洲最早人类。 战国时期，这里是滇族部落的生息之地。云南即 彩云之南、七彩云南，另一说法是因位于“ 云岭之南”而得名。 [3] ? 云南国土总面积39.41万平方千米，占全国国土总面积的4.1%，居全国第8位，总人口4770.5万人（2016年） [4] ? ，是中国民族种类最多的省份，下辖8个市、8个少数民族自治州。 [3] ? 云南动植物种类数为全国之冠，素有“动植物王国”之称，被誉为“有色金属王国”，历史文化悠久，自然风光绚丽，有 丽江古城、 三江并流、 石林、 哈尼梯田、 大理古城、 崇圣寺三塔、 玉龙雪山、 洱海、 滇池、 噶丹松赞林寺、 西双版纳热带雨林等 旅游 景点。 [5-7] ?');
INSERT INTO "MOON"."DETAIL" VALUES ('app', '手机软件，主要指安装在智能手机上的 软件，完善原始系统的不足与个性化。 使手机完善其功能，为 用户提供更丰富的使用体验的主要手段。 手机软件的运行需要有相应的手机系统，目前（2017年6月1日）主要的手机系统：1. 苹果公司的iOS.2. 谷歌公司的 Android（安卓）系统。 早期的手机主流系统有以下： Symbian、BlackBerry OS、 Windows Mobile.但是在2007年，苹果推出了运行自己软件的 iPhone；Google宣布推出Android 手机操作系统平台。苹果跟安卓两款系统凭着强大的优势，迅速占领手机市场大部分份额。 360发布了《2015年Android手机应用盗版情况调研报告》，通过内容显示2015年安卓手机应用盗版情况仍然猖獗，平均每款正版App对应92.7个盗版，工具类软件以及模拟辅助类游戏最易遭仿冒。 [1] ? 2018年1月， 工信部回应：网络运营者必须为用户提供注销账号的服务。 [2] ? 手机APP滥开隐私权限，侵犯用户利益的情况太普遍，需要采取严厉措施加以规范，对违规行为依法重罚。2018年11月28日，中国消费者协会在京发布《100款App个人信息收集与隐私政策测评报告》。报告显示，100款App中，超过九成App列出的权限存在涉嫌“越界”，即存在过度收集用户个人信息的问题。 [3] ? 2018年12月，国家网信办会同有关部门针对网民反映强烈的违法违规、低俗不良移动应用程序(APP)乱象，集中开展清理整治专项行动，依法关停下架3469款涉黄涉赌、恶意扣费、窃取隐私、诱骗诈骗、违规游戏、不良学习类APP。 [4] ?');
INSERT INTO "MOON"."DETAIL" VALUES ('详解', '该词暂时没有解释');
INSERT INTO "MOON"."DETAIL" VALUES ('码', '码汉语 汉字，读音mǎ，意思有5种，分别是计算数量的用具。代表数目的符号。指一件事或一类的事。英美制长度单位。堆叠。古同“玛”，玛瑙。出自《儿女英雄传》。');
INSERT INTO "MOON"."DETAIL" VALUES ('源码', '源码就是指编写的最原始程序的代码。运行的软件是要经过编写的，程序员编写程序的过程中需要他们的“语言”。音乐家用 五线谱和音符，建筑师用图纸和笔，那程序员的工作的语言就是“源码”了。 人们平时使用软件时就是程序把“源码”翻译成我们可直观的形式表现出来供我们使用的。 [1] ? 任何一个网站页面，换成源码就是一堆按一定格式书写的文字和符号，但我们的浏览器帮我们翻译成眼前的模样了。');
INSERT INTO "MOON"."DETAIL" VALUES ('案例', '案例，就是人们在生产生活当中所经历的典型的富有多种意义的事件陈述。它是人们所经历的故事当中的有意截取。案例一般包括三大要素。案例对于人们的学习，研究，生活借鉴等具有重要意义。基于案例的教学是通过案例向人们传递有针对性的教育意义的有效载体。因此，人们常常把案例作为一种工具进行说服，进行思考，进行教育。故案例在人们的研究中形成了一定的书写格式，标准样式，为人们更好的适应案例情景提供很多方便。');
INSERT INTO "MOON"."DETAIL" VALUES ('docker', 'Docker 是一个 开源的应用容器引擎，让开发者可以打包他们的应用以及依赖包到一个可移植的容器中，然后发布到任何流行的 Linux 机器上，也可以实现 虚拟化。容器是完全使用 沙箱机制，相互之间不会有任何接口。 [1] ?');
INSERT INTO "MOON"."DETAIL" VALUES ('core', 'core，是一个英文单词，意思是果核,果心。');
INSERT INTO "MOON"."DETAIL" VALUES ('链', '链(Chain)是一个 英制长度单位，定义为66呎( 英尺)(20.1168米)，又称为“冈特测链”(Gunter''s chain)。');
INSERT INTO "MOON"."DETAIL" VALUES ('联网', '在信息技术里，联网（networking）是指运行于不同计算机上的多个进程之间的通信。这个通信可以发生在一个封闭的局域网上，或者通过互联网通信。网络在应用软件的一个主要用途就是允许一个或多个应用程序使用其他应用程序提供的服务。除了LabVIEW的Web发布功能，还可以使用一些网络功能与其他软件或者LabVIEW程序通信。 [1] ?');
INSERT INTO "MOON"."DETAIL" VALUES ('系统', '能够完成一种或者几种生理功能的多个器官按照一定的次序 组合在一起的结构叫做系统。 系统一词创成于英文system的音译，并对应其外文内涵加以丰富。系统是指将零散的东西进行有序的 整理、 编排形成的具有整体性的 整体。 在数字信号处理的理论中，人们把能加工、变换数字信号的实体称作系统。由于处理数字信号的系统是在指定的时刻或时序对信号进行加工运算，所以这种系统被看作是离散时间的，也可以用基于时间的 语言、 表格、 公式、 波形四种方法来 描述。 [1] ? 从抽象的意义来说，系统和信号都可以看作是序列。但是，系统是加工信号的机构，这点与信号不同。人们研究系统，设计系统，利用系统加工信号、服务人类。 除上文的四种描述方法，描述系统的方法还有符号、单位 脉冲响应、差分方程和图形。 中国著名学者 钱学森认为：系统是由相互作用相互依赖的若干组成部分结合而成的，具有特定功能的 有机整体，而且这个有机整体又是它从属的更大系统的 组成部分。 [2] ? 运动着的若干部分，在相互联系、相互作用之中形成的具有某种确定功能的整体，谓之系统。');
INSERT INTO "MOON"."DETAIL" VALUES ('物', '物，读作wù，属于常用字。本意是指杂色牛，引申指毛色、杂色，这些意义只见于上古。因杂色含有众多的意思，故引申为万事万物。另一意说，物本意指万物，引申指具体的物品，还特指自己以外的人、事、物，多指众人。');
INSERT INTO "MOON"."DETAIL" VALUES ('服务', '服务是指为他人做事，并使他人从中 受益的一种有偿或无偿的活动。不以实物形式而以提供劳动的形式满足他人某种特殊需要。');
INSERT INTO "MOON"."DETAIL" VALUES ('mysql', 'MySQL是一个 关系型数据库管理系统 ，由瑞典MySQL AB 公司开发，目前属于 Oracle 旗下产品。MySQL 是最流行的 关系型数据库管理系统之一，在 WEB 应用方面，MySQL是最好的 RDBMS (Relational Database Management System，关系数据库管理系统) 应用软件。 MySQL是一种关系数据库管理系统，关系数据库将数据保存在不同的表中，而不是将所有数据放在一个大仓库内，这样就增加了速度并提高了灵活性。 MySQL所使用的 SQL 语言是用于访问 数据库的最常用标准化语言。MySQL 软件采用了双授权政策，分为社区版和商业版，由于其体积小、速度快、总体拥有成本低，尤其是 开放源码这一特点，一般中小型网站的开发都选择 MySQL 作为网站数据库。 由于其社区版的性能卓越，搭配 PHP 和 Apache 可组成良好的开发环境。');
INSERT INTO "MOON"."DETAIL" VALUES ('程序员', '程序员（英文Programmer）是从事程序开发、程序维护的专业人员。一般将程序员分为程序设计人员和程序编码人员，但两者的界限并不非常清楚，特别是在中国。软件从业人员分为 初级程序员、中级程序员、高级程序员（现为软件设计师）、 系统分析员， 系统架构师， 测试工程师六大类。');
INSERT INTO "MOON"."DETAIL" VALUES ('流程', '是一个汉语词汇，拼音为liú chéng，基本意思是指水流的路程；事物进行中的次序或顺序的布置和安排；或指由两个及以上的业务步骤，完成一个完整的业务行为的过程。出自《赞女子采油队》、《“外行”书记》等。');
INSERT INTO "MOON"."DETAIL" VALUES ('测试', '测试是具有试验性质的测量，即测量和试验的综合。而测试手段就是仪器仪表。由于测试和测量密切相关，在实际使用中往往并不严格区分测试与测量。测试的基本任务就是获取有用的信息，通过借助专门的 仪器、设备，设计合理的实验方法以及进行必要的 信号分析与数据处理，从而获得与被测对象有关的 信息。最后将结果提供显示或输入其他信息处理装置、 控制系统。 [1] ?');
INSERT INTO "MOON"."DETAIL" VALUES ('数据', '数据(data)是事实或观察的结果，是对客观事物的逻辑归纳，是用于表示客观事物的未经加工的的原始素材。 数据可以是连续的值，比如声音、图像，称为 模拟数据。也可以是离散的，如符号、文字，称为 数字数据。 在计算机系统中，数据以二进制信息单元0,1的形式表示。');
INSERT INTO "MOON"."DETAIL" VALUES ('常用', '常用指 经常使用；日常应用。出自《 墨子·小取》等书。');
INSERT INTO "MOON"."DETAIL" VALUES ('实例', '实例，指实际的例子。语出 鲁迅 《呐喊·风波》：“总之现在的世界是不对了。何况 六斤 比伊的曾祖，少了三斤，比伊父亲 七斤 ，又少了一斤，这真是一条 颠扑不破的实例。”');
INSERT INTO "MOON"."DETAIL" VALUES ('区块', '区块链（英语：blockchain 或 block chain）是用 分布式数据库识别、传播和记载信息的智能化 对等网络, 也称为价值互联网。 中本聪在2008年，于《 比特币白皮书》中提出“区块链”概念，并在2009年创立了比特币社会网络，开发出第一个区块，即“创世区块”。 区块链共享价值体系首先被众多的 加密货币效仿，并在 工作量证明上和算法上进行了改进，如采用 权益证明和SCrypt算法。随后，区块链生态系统在全球不断进化，出现了首次代币发售ICO；智能合约区块链 以太坊；“轻所有权、重使用权”的资产代币化 共享经济； 和区块链国家。目前，人们正在利用这一共享价值体系，在各行各业开发去中心化电脑程序(Decentralized applications, Dapp)，在全球各地构建去中心化自主组织和去中心化自主社区(Decentralized autonomous society, DAS)。');
INSERT INTO "MOON"."DETAIL" VALUES ('项目', '项目是指一 系列独特的、复杂的并 相互 关联的活动，这些活动有着一个明确的 目标或 目的，必须在特定的时间、预算、资源限定内，依据规范 完成。 叶圣陶 《倪焕之》二五：“教育这个项目当然是不容轻易忽略的。” 洪深 《戏剧导演的初步知识》上篇二：“它们的式样、大小、制造的材料、使用的方法等等，项目繁多。” 秦牧 《艺海拾贝·核心》：“生动的语言和丰富的词汇，看来该是技巧性很强的一个项目了。” 项目参数包括 项目范围、质量、成本、时间、资源。美国项目管理协会（project Management Institute，PMI)在其出版的《项目管理知识体系指南》（Project Management Body of Knowledge，PMBOK）中为项目所做的定义是：项目是为创造独特的产品、服务或成果而进行的临时性工作。以下活动都可以称为一个项目： 1、开发一项新产品； 2、计划举行一项大型活动（如策划组织婚礼、大型国际会议等）； 3、策划一次 自驾游旅游； 4、ERP的咨询、开发、实施与培训。');
INSERT INTO "MOON"."DETAIL" VALUES ('管理', '管理是指一定组织中的管理者，通过实施计划、组织、领导、协调、控制等职能来协调他人的活动，使别人同自己一起实现既定目标的活动过程。是人类各种组织活动中最普通和最重要的一种活动。近百年来，人们把研究管理活动所形成的管理基本原理和方法，统称为管理学。作为一种知识体系，管理学是管理思想、管理原理、管理技能和方法的综合。随着管理实践的发展，管理学不断充实其内容，成为指导人们开展各种管理活动，有效达到管理目的的指南。 [1] ?');
INSERT INTO "MOON"."DETAIL" VALUES ('智能', '智能，是智力和能力的总称，中国古代思想家一般把智与能看做是两个相对独立的概念。');
INSERT INTO "MOON"."DETAIL" VALUES ('年度', '年度，是指的某个年份的一整年，如2012年的一整年算一个年度根据业务性质和需要而规定的有一定 起讫日期的十二个月。');
INSERT INTO "MOON"."DETAIL" VALUES ('分享', '分享是一个 汉语词汇，读音为fēn xiǎng，是指与他人分着享受、 使用、行使。语出 清 黄六鸿《 福惠全书·杂课·牙税》：“与该房分享其利。”');
INSERT INTO "MOON"."DETAIL" VALUES ('人生', '《人生》是作家 路遥创作的小说，也是其成名作。原载《 收获》1982年第三期，获1981——1982全国优秀中篇小说奖。 小说以改革时期 陕北高原的城乡生活为时空背景，描写了高中毕业生 高加林回到土地又离开土地，再离开土地，再回到土地这样人生的变化过程构成了其故事构架。高加林同农村姑娘 刘巧珍，城市姑娘 黄亚萍之间的感情纠葛构成了故事发展的矛盾，也正是体现那种艰难选择的悲剧。 2018年9月27日，路遥的《人生》 入选“ 中国改革开放四十周年最有影响力小说”。 [1] ?');
INSERT INTO "MOON"."DETAIL" VALUES ('数据库', '数据库，简而言之可视为 电子化的 文件柜——存储电子 文件的处所，用户可以对文件中的数据运行新增、截取、更新、删除等操作。 所谓“数据库”是以 一定方式储存在一起、能与多个用户 共享、具有尽可能小的 冗余度、与应用程序彼此独立的数据 集合。');
INSERT INTO "MOON"."DETAIL" VALUES ('程序人生', '程序人生，讲诉程序员的心声和职业生涯，并且免费分享开源项目，程序员故事，IT创业精神，为广大的计算机编程爱好者提供编程入门教程、详细解释各大编程语言所涉及到的技术和有助于开发的编程软件工具为主题的编程技术网站');
INSERT INTO "MOON"."DETAIL" VALUES ('大数据', '大数据（big data），指无法在一定时间范围内用常规软件工具进行捕捉、管理和处理的数据集合，是需要新处理模式才能具有更强的决策力、洞察发现力和流程优化能力的海量、高增长率和多样化的信息资产。 [1]  
INSERT INTO "MOON"."DETAIL" VALUES ('运维', '运维，这里指互联网运维，通常属于技术部门，与研发、测试、系统管理同为互联网产品技术支撑的4大部门，这个划分在国内和国外以及大小公司间都会多少有一些不同。
INSERT INTO "MOON"."DETAIL" VALUES ('编程语言', '编程语言（programming language），是用来定义计算机程序的形式语言。它是一种被标准化的交流技巧，用来向计算机发出指令。一种计算机语言让程序员能够准确地定义计算机所需要使用的数据，并精确地定义在不同情况下所应当采取的行动。 [1] 
INSERT INTO "MOON"."DETAIL" VALUES ('区块链', '区块链是分布式数据存储、点对点传输、共识机制、加密算法等计算机技术的新型应用模式。 [1]  
INSERT INTO "MOON"."DETAIL" VALUES ('架构', '架构，又名软件架构，是有关软件整体结构与组件的抽象描述，用于指导大型软件系统各个方面的设计。架构描述语言（ADL）用于描述软件的体系架构。现在已有多种架构描述语言，如Wright（由卡内基梅隆大学开发），Acme（由卡内基梅隆大学开发），C2（由UCI开发），Darwin（由伦敦帝国学院开发）。ADL的基本构成包括组件、连接器和配置。');
INSERT INTO "MOON"."DETAIL" VALUES ('人工智能', '人工智能（Artificial Intelligence），英文缩写为AI。它是研究、开发用于模拟、延伸和扩展人的智能的理论、方法、技术及应用系统的一门新的技术科学。
INSERT INTO "MOON"."DETAIL" VALUES ('备份', '如果 系统的硬件或存储媒体发生故障，“备份”工具可以帮助您保护数据免受意外的损失。例如，可以使用“备份”创建硬盘中数据的副本，然后将 数据存储到其他存储设备。备份存储媒体既可以是 逻辑驱动器（如硬盘）、独立的存储设备（如可移动磁盘），也可以是由自动转换器组织和控制的整个磁盘库或 磁带库。如果硬盘上的原始数据被意外删除或覆盖，或因为 硬盘故障而不能访问该 数据，那么您可以十分方便的从存档副本中还原该数据。');
INSERT INTO "MOON"."DETAIL" VALUES ('详解', '该热词暂时没有解释');
INSERT INTO "MOON"."DETAIL" VALUES ('开发', '开发，是指以荒地、矿山、森林、水力等自然资源为对象进行劳动，以达到利用的目的；开拓；发现或发掘人才、技术等供利用。发掘、收集、整理、选择文化资源等');
INSERT INTO "MOON"."DETAIL" VALUES ('程序', '在国标《 质量管理体系 基础和术语》GB/T19000—2008/ISO9000：2005中第3.4.5条 程序procedure中对于“程序”的定义进行了规定。 一个环节，内部嵌套着一系列复杂的列逻辑慎密的一个组件，如若一个地方出问题则会影响到整个主体（可以理解为事务）。');
